(490, 14, 'what_we_hear_from_client_boxes_0_what_we_hear_from_client_box_title', 'A limited partnership formed to invest in small and mid-market real estate'),
(491, 14, '_what_we_hear_from_client_boxes_0_what_we_hear_from_client_box_title', 'field_61b3635b44b7d'),
(492, 14, 'what_we_hear_from_client_boxes_0_what_we_hear_from_client_box_image', '68'),
(493, 14, '_what_we_hear_from_client_boxes_0_what_we_hear_from_client_box_image', 'field_61b3633844b7c'),
(494, 14, 'what_we_hear_from_client_boxes_0_what_we_hear_from_client_box_content', 'The Funds target size is $500M with individual properties valued between $5M and $75M. The Fund will include select retail, ofce, industrial, and multi-residential properties located across Canada in major markets and specic secondary markets. Each sector class has a targeted strategy.'),
(495, 14, '_what_we_hear_from_client_boxes_0_what_we_hear_from_client_box_content', 'field_61b3636344b7e'),
(496, 14, 'what_we_hear_from_client_boxes_1_what_we_hear_from_client_box_tag_title', 'Investment Strategy'),
(497, 14, '_what_we_hear_from_client_boxes_1_what_we_hear_from_client_box_tag_title', 'field_61b3645b227a1'),
(498, 14, 'what_we_hear_from_client_boxes_1_what_we_hear_from_client_box_title', 'Canadian Urbans disciplined approach to investments: weight returns versus risk.'),
(499, 14, '_what_we_hear_from_client_boxes_1_what_we_hear_from_client_box_title', 'field_61b3635b44b7d'),
(500, 14, 'what_we_hear_from_client_boxes_1_what_we_hear_from_client_box_image', '70'),
(501, 14, '_what_we_hear_from_client_boxes_1_what_we_hear_from_client_box_image', 'field_61b3633844b7c'),
(502, 14, 'what_we_hear_from_client_boxes_1_what_we_hear_from_client_box_content', 'The Fund will construct a $500M stable, cash flowing and diversied real estate portfolio across Canada with targeted returns of +8.0% levered IRRs on a net of fee basis. Once the Fund is fully placed, an intensive and active management process commences.'),
(503, 14, '_what_we_hear_from_client_boxes_1_what_we_hear_from_client_box_content', 'field_61b3636344b7e'),
(504, 14, 'what_we_hear_from_client_boxes_2_what_we_hear_from_client_box_tag_title', 'Our Track Record'),
