(510, 14, 'what_we_hear_from_client_boxes_2_what_we_hear_from_client_box_content', 'Canadian Urban has an exceptional track record of performance, consis-tently delivering returns that exceed benchmark targets. For over 20 years, CU has delivered top quar-tile returns to its clients. CUs total returns ranked third in MSCIs all-time index of Canadian Real Estate Managers (since 2000).'),
