(611, 71, 'what_we_hear_from_client_boxes_0_what_we_hear_from_client_box_content', 'The Funds target size is $500M with individual properties valued between $5M and $75M. The Fund will include select retail, ofce, industrial, and multi-residential properties located across Canada in major markets and specic secondary markets. Each sector class has a targeted strategy.'),
(612, 71, '_what_we_hear_from_client_boxes_0_what_we_hear_from_client_box_content', 'field_61b3636344b7e'),
