(615, 71, 'what_we_hear_from_client_boxes_1_what_we_hear_from_client_box_title', 'Canadian Urbans disciplined approach to investments: weight returns versus risk.'),
(616, 71, '_what_we_hear_from_client_boxes_1_what_we_hear_from_client_box_title', 'field_61b3635b44b7d'),
(617, 71, 'what_we_hear_from_client_boxes_1_what_we_hear_from_client_box_image', '69'),
