(619, 71, 'what_we_hear_from_client_boxes_1_what_we_hear_from_client_box_content', 'The Fund will construct a $500M stable, cash flowing and diversied real estate portfolio across Canada with targeted returns of +8.0% levered IRRs on a net of fee basis. Once the Fund is fully placed, an intensive and active management process commences.'),
(620, 71, '_what_we_hear_from_client_boxes_1_what_we_hear_from_client_box_content', 'field_61b3636344b7e'),
