(623, 71, 'what_we_hear_from_client_boxes_2_what_we_hear_from_client_box_title', 'CUs performance reinforces our confidence in the Fund and our ability to deliver solid results.'),
(624, 71, '_what_we_hear_from_client_boxes_2_what_we_hear_from_client_box_title', 'field_61b3635b44b7d'),
