(1262, 106, '_what_we_hear_from_client_main_next_title', 'field_61b362ed44b7a'),
(1263, 106, 'what_we_hear_from_client_main_description', 'The CU7 Real Estate Fund LP is a limited partnership formed to invest in small and mid-market real estate. The Fund seeks to deliver superior risk-adjusted returns through an active and agile management style  a performance driver demonstrated over CUs 50-year history.'),
