(1269, 106, 'what_we_hear_from_client_boxes_0_what_we_hear_from_client_box_title', 'A limited partnership formed to invest in small and mid-market real estate'),
(1270, 106, '_what_we_hear_from_client_boxes_0_what_we_hear_from_client_box_title', 'field_61b3635b44b7d'),
(1271, 106, 'what_we_hear_from_client_boxes_0_what_we_hear_from_client_box_image', '68'),
(1272, 106, '_what_we_hear_from_client_boxes_0_what_we_hear_from_client_box_image', 'field_61b3633844b7c'),
(1273, 106, 'what_we_hear_from_client_boxes_0_what_we_hear_from_client_box_content', 'The Funds target size is $500M with individual properties valued between $5M and $75M. The Fund will include select retail, ofce, industrial, and multi-residential properties located across Canada in major markets and specic secondary markets. Each sector class has a targeted strategy.'),
(1274, 106, '_what_we_hear_from_client_boxes_0_what_we_hear_from_client_box_content', 'field_61b3636344b7e'),
(1275, 106, 'what_we_hear_from_client_boxes_1_what_we_hear_from_client_box_tag_title', 'Investment Strategy'),
(1276, 106, '_what_we_hear_from_client_boxes_1_what_we_hear_from_client_box_tag_title', 'field_61b3645b227a1'),
(1277, 106, 'what_we_hear_from_client_boxes_1_what_we_hear_from_client_box_title', 'Canadian Urbans disciplined approach to investments: weight returns versus risk.'),
(1278, 106, '_what_we_hear_from_client_boxes_1_what_we_hear_from_client_box_title', 'field_61b3635b44b7d'),
(1279, 106, 'what_we_hear_from_client_boxes_1_what_we_hear_from_client_box_image', '70'),
(1280, 106, '_what_we_hear_from_client_boxes_1_what_we_hear_from_client_box_image', 'field_61b3633844b7c'),
(1281, 106, 'what_we_hear_from_client_boxes_1_what_we_hear_from_client_box_content', 'The Fund will construct a $500M stable, cash flowing and diversied real estate portfolio across Canada with targeted returns of +8.0% levered IRRs on a net of fee basis. Once the Fund is fully placed, an intensive and active management process commences.'),
(1282, 106, '_what_we_hear_from_client_boxes_1_what_we_hear_from_client_box_content', 'field_61b3636344b7e'),
(1283, 106, 'what_we_hear_from_client_boxes_2_what_we_hear_from_client_box_tag_title', 'Our Track Record'),
(1284, 106, '_what_we_hear_from_client_boxes_2_what_we_hear_from_client_box_tag_title', 'field_61b3645b227a1'),
(1285, 106, 'what_we_hear_from_client_boxes_2_what_we_hear_from_client_box_title', 'CUs performance reinforces our confidence in the Fund and our ability to deliver solid results.'),
(1286, 106, '_what_we_hear_from_client_boxes_2_what_we_hear_from_client_box_title', 'field_61b3635b44b7d'),
(1287, 106, 'what_we_hear_from_client_boxes_2_what_we_hear_from_client_box_image', '69'),
(1288, 106, '_what_we_hear_from_client_boxes_2_what_we_hear_from_client_box_image', 'field_61b3633844b7c'),
(1289, 106, 'what_we_hear_from_client_boxes_2_what_we_hear_from_client_box_content', 'Canadian Urban has an exceptional track record of performance, consis-tently delivering returns that exceed benchmark targets. For over 20 years, CU has delivered top quar-tile returns to its clients. CUs total returns ranked third in MSCIs all-time index of Canadian Real Estate Managers (since 2000).'),
(1290, 106, '_what_we_hear_from_client_boxes_2_what_we_hear_from_client_box_content', 'field_61b3636344b7e'),
